    #region DXF Data Struct Class
    public class CircleStruct
    {
        public int circle { get; set; }
        public Vector3 center { get; set; }
        public double radius { get; set; }
    }
    public class LineStruct
    {
        public int line { get; set; }
        public Vector3 startpoint { get; set; }
        public Vector3 endpoint { get; set; }
    }
    public class Polylines2DStruct
    {
        public int polylines2D { get; set; }
        public double posX { get; set; }
        public double posY { get; set; }
    }
    #endregion

    #region Config Class
    public class SerialNumber
    {
        [JsonProperty("Open_Writing_DXF_Path_val")]
        public string Open_Writing_DXF_Path_val { get; set; }
        [JsonProperty("Open_Reading_DXF_Path_val")]
        public string Open_Reading_DXF_Path_val { get; set; }
    }

    public class Model
    {
        [JsonProperty("SerialNumbers")]
        public SerialNumber SerialNumbers { get; set; }
    }

    public class RootObject
    {
        [JsonProperty("Models")]
        public List<Model> Models { get; set; }
    }
    #endregion

